unsigned char t3_get_chartype(wchar_t ch)
{
    unsigned int pg = (ch / 128);
    unsigned int ofs = (ch % 128);

    return (t3_attr_main[pg] != 0
            && t3_attr_main[pg][ofs] != 0
            ? t3_attr_main[pg][ofs]
            : T3_CTYPE_NONE);
}

